  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic organisms were collected using
  sediment sampler casts from the EXCELLENCE in the Gulf of Mexico from 19 December
  1979 to 19 December 1979. Data were submitted by the Texas A&M University with support
  from the Brine Disposal project.nnThe F132 format contains data from field sampling
  or surveys of bottom dwelling marine organisms. The data provide information on
  species abundance, distribution, and biomass; they may have been collected by point
  sampling (grab or core), by tow (dredge, trawl or net), by photographic surveys,
  or by other methods. Cruise information such as vessel, start and end dates, investigator,
  and institution/agency; station numbers, positions and times; and equipment and
  methods are reported for each survey. Environmental data reported at each sampling
  site may include meteorological and sea surface conditions; surface and bottom temperature,
  salinity and dissolved oxygen; and sediment characteristics. Number of individual
  organisms and total weight of organisms is reported for each species. A text record
  is available for comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
